なんといっても角川武蔵野ミュージアム😳
近くで見るととんでもなく大きいので実際に体感してほしい
今回建物内には入らなかったので早く中に入りたい
角のカフェは営業中でした（この日はドリンクのみ）

プレオープンの期間なのでご注意

東所沢駅からは歩いていける距離です
道路のアートマンホールを探しつつ向かうと
とても楽しい

途中の公園内ではチームラボもやってます
ライトアップが綺麗らしいので今度は夜に行ってみます

（2020年8月5日時点の写真情報）

